import React from "react";

const Menu = () => {
  categoryDataRedux?.map((item, index) => {
    return <div key={index}>{item}</div>;
  });

  return (
    <div className="flex flex-row items-center justify-center gap-1.5 h-12 cursor-pointer">
      <svg
        fill="#FFFFFF"
        xmlns="http://www.w3.org/2000/svg"
        viewBox="0 0 50 50"
